contracts/Sensor.sol.content:
pragma solidity ^0.8.0;

contract SensorContract {
    uint256 public temperature;
    uint256 public humidity;
    uint256 public pressure;
    uint256 public vibration;
    uint256 public lastVibrationTime;
    bool public isContractActive = true;

    function setSensorValues(uint256 _temperature, uint256 _humidity, uint256 _pressure, uint256 _vibration) public {
        temperature = _temperature;
        humidity = _humidity;
        pressure = _pressure;
        vibration = _vibration;
        
        if (temperature < 9 || temperature > 26 || pressure < 70 || pressure > 110 || vibration == 1) {
            isContractActive = false;
        }
        
        if (vibration == 1) {
            lastVibrationTime = block.timestamp;
        }
        
        if (block.timestamp - lastVibrationTime > 10 seconds) {
            isContractActive = false;
        }
    }
}

